import React from "react"
import { Link } from "react-router-dom";

export default function HomeIcon() {
    return (
        <Link 
            to={"/"}
            style={{
                fontSize: 40,
                textDecoration:"none",
                color:"white",
                fontWeight:"thin"
            }}
        >
            nanovert
        </Link>
    )
}
